import { Route, Routes } from 'react-router-dom';
import Welcome from './components/Welcome';
import Products from './components/Products';

function App() {
  return (
    <div>
      <Routes>
      <Route path="/welcome" element={<Welcome />}/>


        <Route path="/product">
          <Products />
        </Route>
        </Routes>
    </div>
  );
}

export default App;
